const a=JSON.parse('{"key":"v-00469b8a","path":"/java/java-collection/java-collection-map.html","title":"Java 集合之Map","lang":"zh-CN","frontmatter":{},"headers":[{"level":3,"title":"Map集合","slug":"map集合","link":"#map集合","children":[]}],"git":{"createdTime":1659075927000,"updatedTime":1659075927000,"contributors":[{"name":"诗人都藏在水底","email":"895252461@qq.com","commits":1}]},"readingTime":{"minutes":7.34,"words":2203},"filePathRelative":"java/java-collection/java-collection-map.md","localizedDate":"2022年7月29日","excerpt":"<h1> Java 集合之Map</h1>\\n<h3> Map集合</h3>\\n<p>Map是一种键值对(key-value)集合，Map集合中的每一个元素都包含一个键对象和一个值对象。其中，键对象不允许重复，而值对象可以重复。</p>\\n<h4> HashMap</h4>\\n<p>HashMap使用数组+链表+树来实现。</p>\\n<p>由于在实际使用场景中，Hash Map的size较小，在计算hash的时候，hash冲突的概率会很大，所以HashMap的主要工作就是解决hash冲突和扩缩容</p>\\n<h5> 如何解决hash冲突问题？</h5>\\n<p><strong>一：先聊聊HashMap的存储结构</strong></p>"}');export{a as data};
